import React from 'react';
import './Login.css';

const Login = () => {
  return (
    <div className="login">
      <h2>Login to CivicFix</h2>
      <input type="text" placeholder="Email / Phone Number" />
      <input type="password" placeholder="Password" />
      <button>Login</button>
      <button>Register</button>
    </div>
  );
};

export default Login;
